function superficieDoParalelepipedoQuadrado(ladodabase, comprimento) {
  let paraleQuadrado = 2 * (ladodabase ** 2 + 2 * ladodabase * comprimento);
  return paraleQuadrado;
}

console.log(superficieDoParalelepipedoQuadrado(5, 10));
